// HomeScreen.js
import React from 'react';
import { View, Text } from 'react-native';

const HomeScreen = () => {
  return (
    <View>
      <Text>Home Screen</Text>
      <Icon name="home" size={30} color="#000" />
    </View>
  );
};

export default HomeScreen;
